<8be7e56ab32ba602fe21f50ea3f62822>"a:2:{s:4:\"type\";s:25:\"PayplansAppEmailFormatter\";s:7:\"content\";a:3:{s:7:\"user_id\";s:4:\"7030\";s:7:\"subject\";s:29:\"Your Premium CPD Subscription\";s:4:\"body\";s:1086:\"<p>Dear Ikhab Al-khalili,<\/p>\r\n<p>Thank you for subscribing to our Premium CPD subscription plan. This gives you access to our extensive library of CPD courses. In addition to those available on-demand, remember that you will also be able to join in our <a href=\"my-learning\/live-webinars\">Evening Expert webinars<\/a>, during which you will be able to meet with other like-minded professionals.<\/p>\r\n<p>New content is added regularly, so look out for the notifications on the site, our social media pages and our newsletter.<\/p>\r\n<p>This is a recurring subscription that will automatically renew each month until cancelled. You may cancel at any time whilst it is active by logging into your PayPal account and cancelling the payment. Please note that it cannot be cancelled directly from our website.<\/p>\r\n<p>I very much hope that you find our CPD service of great benefit and look forward to meeting you on-line.<\/p>\r\n<p>Regards,<\/p>\r\n<p>Andrew<\/p>\r\n<hr \/>\r\n<p>Andrew Gould<br \/> Founder, <a href=\"https:\/\/www.dental-channel.co.uk\/\">The Dental Channel<\/a><br \/>+44 (0)20 8299 9742<\/p>\";}}"</8be7e56ab32ba602fe21f50ea3f62822>
